import axios from "axios";

const API_URL = process.env.REACT_APP_BACKEND_URL || "http://localhost:5000";

const login = async (email, password) => {
  const res = await axios.post(`${API_URL}/api/auth/login`, {
    email,
    password,
  });
  return res.data;
};

export default { login };
